@Entity注解表示定义该类为一个实体类；
@TableName指定当前实体类对应的数据表名称，建立实体类和数据表的映射关系；
@TableId注解声明当前属性对应数据表的主键，并指定主键策略为自动增长。
如果实体类的字段名与数据库中的字段名不匹配，可以在属性的上方使用@TableField注解指定对应的字段名。如果属性名称和字段名称一致，可以省略。

@Cacheable注解用于标识可缓存的方法。
@CachePut注解的作用是更新缓存数据。
@CacheEvict注解的可以删除缓存中的数据。
@CacheConfig注解使用在类上，主要用于统筹管理类中所有使用@Cacheable、@CachePut和@CacheEvict注解标注方法中的公共属性。

@Cacheable注解用于标识可缓存的方法。
@CachePut注解的作用是更新缓存数据。
@CacheEvict注解的可以删除缓存中的数据。
@Caching注解用于针对复杂规则的数据缓存管理。

@RedisHash：该注解在类上进行标注，用于指定将数据类映射到Redis中的存储空间。
@Id：用于标识实体类主键。
@Indexed：用于标识对应属性在Redis数据库中生成二级索引。
@TableField:MyBatis-Plus指定实体类中属性对应字段名的注解.
